import React from 'react';

const Product = (props) => {
    const { name, price, category, seller, img } = props.product;
    return (
        <div className="product">
            <div className="">
                <img src={img} alt="" />
            </div>

            <div className="">
                <h3>Name: {name}</h3>
                <h4>Catagory: {category}</h4>
                <h5>Price: ${price}</h5>
                <p><small>by: {seller}</small></p>
            </div>

        </div>
    );
};

export default Product;
